This formerly unknown date was released for the first time on this 1988 CD; chances are that the short-lived Candid label died before the music could be put out. 

Don Ellis, one of the most original trumpeters to emerge in the early 1960's, performs ten standards on a trio session with pianist Paul Bley and bassist Steve Swallow (who was making his recording debut) but the music is far from routine or predictable.

Ellis takes an unaccompanied trumpet solo on &quot;Just One Of Those Things,&quot; &quot;All The Things You Are&quot; is a trumpet-bass duet and Ellis interacts with Bley on a moody &quot;My Funny Valentine.&quot; The players constantly take chances with time but there are few slipups or hesitant moments. A fascinating and long-lost session.


